// ==UserScript==
// @name         GC Image Enhance
// @namespace    http://tampermonkey.net/
// @version      1.4
// @description  Why on earth would I settle for a _l?
// @author       Brian
// @match        https://s3.amazonaws.com/gs-geo-images/*
// @match        https://d1u1p2xjjiahg3.cloudfront.net/*
// @updateURL    https://github.com/Brainiac03/GC-Image-Enhance/raw/main/main.user.js
// @downloadURL  https://github.com/Brainiac03/GC-Image-Enhance/raw/main/main.user.js
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==

var imgurl = window.location.href;
// _l, _t, _a currently in use; checking for underscore at ind(-6) allows for all cases to be met with one condition
if (imgurl.at(-6) == "_") {
    let newurl = imgurl.slice(0, -6) + imgurl.slice(-4);
    window.open(newurl, "_self");
}
